def predict(triples: list[Triple]) -> str:
    sentence = ""
    if not triples:
        return sentence

    subject = triples[0].subject
    sentence += f"{subject} "

    properties = []
    for triple in triples:
        if triple.predicate == "cityServed":
            properties.append(f"serves the city of {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            properties.append(f"is {triple.object} metres above sea level")
        elif triple.predicate == "location":
            properties.append(f"is located in {triple.object}")
        elif triple.predicate == "operatingOrganisation":
            properties.append(f"is operated by {triple.object}")
        elif triple.predicate == "runwayLength":
            properties.append(f"has a runway length of {triple.object} metres")
        elif triple.predicate == "runwayName":
            properties.append(f"has a runway named {triple.object}")
        elif triple.predicate == "isPartOf":
            properties.append(f"is part of {triple.object}")
        elif triple.predicate == "1stRunwayLengthFeet":
            properties.append(f"has a first runway length of {triple.object} feet")
        elif triple.predicate == "1stRunwaySurfaceType":
            properties.append(f"has a first runway surface type of {triple.object}")
        elif triple.predicate == "3rdRunwayLengthFeet":
            properties.append(f"has a third runway length of {triple.object} feet")
        elif triple.predicate == "icaoLocationIdentifier":
            properties.append(f"has ICAO location identifier {triple.object}")
        elif triple.predicate == "locationIdentifier":
            properties.append(f"has location identifier {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevelInFeet":
            properties.append(f"is {triple.object} feet above sea level")
        elif triple.predicate == "iataLocationIdentifier":
            properties.append(f"has IATA location identifier {triple.object}")
        elif triple.predicate == "nativeName":
            properties.append(f"is also known as {triple.object}")
        elif triple.predicate == "leaderParty":
            properties.append(f"is led by {triple.object}")
        elif triple.predicate == "language":
            properties.append(f"speaks {triple.object}")
        elif triple.predicate == "owner":
            properties.append(f"is owned by {triple.object}")
        elif triple.predicate == "1stRunwayLengthMetre":
            properties.append(f"has a first runway length of {triple.object} metres")
        elif triple.predicate == "4thRunwaySurfaceType":
            properties.append(f"has a fourth runway surface type of {triple.object}")
        elif triple.predicate == "largestCity":
            properties.append(f"has largest city {triple.object}")
        elif triple.predicate == "4thRunwayLengthFeet":
