        elif triple.predicate == "elevationAboveTheSeaLevelInMetres":
            properties.append(f"is {triple.object} metres above sea level")
        elif triple.predicate == "administrativeArrondissement":
            properties.append(f"is in {triple.object}")
        else:
            properties.append(f"is a {triple.predicate}")

    sentence += ", ".join(properties) + "."
    return sentence

